import styled from "styled-components";
import { rawColors } from "../locales/colors";

export const Text = styled.label`
  font-size: 25px;
  color: ${rawColors.blue};
`;

export const MainTitle = styled.label`
  font-size: 35px;
  color: ${rawColors.red};
`;

export const FoodBoxText = styled.section`
  width: 216px;
  d
  overflow: hidden;
  font-family: "PT Serif Caption";
  font-size: 20px;
  font-style: normal;
  font-variant: small-caps;
  font-weight: 100;
  line-height: 24px;
  padding: 2px;
  text-align: center;
`;

export const TextSerif = styled.section`
